var writeStream = fs.createWriteStream('result.csv');

function readResults(results, term, city)
{
	for (var i = results.length - 1; i >= 0; i--) {			
		writeStream.write(term+";"+city+";"+results[i].name+";"+results[i].geometry.location.lat+";"+results[i].geometry.location.lng+";"+"\n");
	}	
}

function fetchPlaces(term, city, radius, done, fail, ptoken){
    googleMapsClient.placesNearby({
      keyword: term,
      location: [city.lat, city.lng],
      radius: radius,
      pagetoken: ptoken ? ptoken : null,
      type: 'university'
    })
    .asPromise()
    .then(function(response) {
		// expect(response.json.next_page_token).not.toBeFalsy();
		if(response.json.results.length)
			readResults(response.json.results, term, city.city);

		if(response.json.next_page_token)
			sleep(1500).then(function() {
			    fetchPlaces(term, city, radius, done, fail, response.json.next_page_token);
			});
		
    })
    .then(done, fail);
}

